import UIKit

let mockImage = ""

enum MockImageError: Swift.Error {
    case couldNotCreateData
    case couldNotCreateUIImage
    case couldNotCreateFile
    case couldNotCreateCIImage
}

func createMockImage() throws -> URL {
    let fileManager: FileManager = .default

    guard let data = Data(base64Encoded: mockImage) else {
        throw MockImageError.couldNotCreateData
    }

    guard let image = UIImage(data: data) else {
        throw MockImageError.couldNotCreateUIImage
    }

    let url = URL(fileURLWithPath: "\(fileManager.currentDirectoryPath)/mock.jpeg")

    guard fileManager.createFile(atPath: url.path, contents: image.jpegData(compressionQuality: 1), attributes: nil) else {
        throw MockImageError.couldNotCreateFile
    }

    guard CIImage(contentsOf: url) != nil else {
        throw MockImageError.couldNotCreateCIImage
    }

    return url
}
